import React from "react";
import { useState } from "react";
import classes from "./Footer.module.css";
import { Link } from "react-router-dom";
const Footer = () => {
  const formHandler = (event) => {
    console.log("ridhima");
    event.preventDefault();
  };
  const buttonHandler = () => {
    console.log("hello");
  };
  return (
    <div className={classes.footer}>
      <img src="/assets/logo.png" />
      <div className={classes.solution}>
        <h3>Services</h3>
        <p>Product Development</p>
        <p>Cloud Transformation</p>
        <p>Operations Transformation</p>
        <p>Analytics</p>
      </div>
      <div className={classes.solution}>
        <h3>Company</h3>
        <p>About Us</p>
        <p>Contact</p>
        <Link to="/Privacy">
          <p>Privacy Policy</p>
        </Link>
        <div>
          <img src="/assets/linkedin.png"></img>
          <img src="/assets/twitter.png"></img>
        </div>
      </div>
      <div className={classes.what}>
        <h4>Want to get in touch with us?</h4>
        <form onSubmit={formHandler}>
          <input type="text" placeholder="Name" />
          <input type="text" placeholder="Company Email" />
          <button onClick={buttonHandler}>Enter</button>
        </form>
      </div>
    </div>
  );
};
export default Footer;
